import { View, Text, Button ,ImageBackground,StyleSheet,Image,ScrollView,SafeAreaView} from "react-native";
import React from "react";

const SkillScreen = ({ navigation }) => {
  return (
    <SafeAreaView>
    <ScrollView>
    <View style={{ flex: 1}}>
    <ImageBackground source={require('../assets/Salah.jpg')} resizeMode="cover" style={styles.image}>
      <View style={{ flex: 1,  alignItems: "center" }}>
        <View style={{padding:30}}>
        
          <View style = {styles.textbox}>
            <Image
                source={require('E:/reactPro/ReactNativeFinalProject/assets/FIFA_Flag_White.png')}
                style={styles.sideMenuProfileIcon}
            />

            <Text style = {styles.text}>เทคนิคฟุตบอล</Text>
            <Text style = {styles.textData}>การเลี้ยงฟุตบอลถือได้ว่าเป็นหนึ่งในทักษะที่สำคัญมากในการเล่นกีฬาฟุตบอล และเป็นสิ่งที่นักฟุตบอลทุกคนจำเป็นจะต้องฝึกฝนเอาไว้ให้ชำนาญเพราะ ถึงคุณจะเก่งอะไรแค่ไหน แต่ไม่สามารถเลี้ยงฟุตบอลผ่านคู่ต่อสู้ไปได้เลยคุณก็จะกลายเป็นจุดอ่อนของทีมไปโดยทันที ดังนั้นเรามาดูกันครับว่าการเลี้ยงฟุตบอลหลบคู่ต่อสู้นั้นมีอะไรและทำอย่างไรบ้าง</Text>
            <Image
                source={require('E:/reactPro/ReactNativeFinalProject/assets/rollover.jpg')}
                style={styles.sideMenuProfileIcon}
            />
            <Text style = {styles.textheadData}>การปาดฟุตบอล (Roll over)</Text>
            <Text style = {styles.textData}>การปาดบอลจัดได้ว่าเป็นเทคนิคที่ง่ายที่สุดในการเลี้ยงฟุตบอลหลบคู่ต่อสู้ แต่ถึงจะเป็นเพียงทักษะเบื้องต้น แต่ก็ใช้ได้ดีเลยทีเดียว โดยท่านี้จะใช้ฝ่าเท้าในการเลี้ยงลูก เริ่มต้นด้วยการเลี้ยงบอลเข้าหาคู่ต่อสู้ และเมื่อฝ่ายตรงข้ามกำลังจะก้าวขาออกมาเพื่อแย่งก็ให้ทำการปาดลูกบอลด้วยฝ่าเท้า โดยปาดไปที่ด้านบนของลูกบอล จะหลบไปทางซ้ายหรือทางขวาแล้วแต่จังหวะและความถนัด</Text>
            <Button
                title='             bookmark             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('Bookmark',{mark:'hello'})   
                }}
                />
                 <Image
                source={require('E:/reactPro/ReactNativeFinalProject/assets/stepover.jpg')}
                style={styles.sideMenuProfileIcon}
            />
            <Text style = {styles.textheadData}>สับขาหลอก (step over, scissor)</Text>
            <Text style = {styles.textData}>การสับขาหลอกเป็นเทคนิคการเลี้ยงบอลหลบที่ใช้กันอย่างแพร่หลายมาก นักเตะหลายคนก็นิยมท่านี้มาก วิธีการทำนั่นคือเมื่อเลี้ยงบอลเข้าจู่โจมฝ่ายตรงข้ามแล้ว ทำให้การสับขาหลอกด้วยการ ก้าวข้ามบอลเป็นวงกลมสลับไปสลับมา โดยใช้ขาทั้ง 2 ข้าง หรือจะใช้ข้างเดียวก็ได้ เพื่อหลอกให้ฝ่ายตรงข้ามเสียจังหวะ ก่อนที่จะกระชากบอลไปในทิศทางที่เหมาะสมเพื่อหลบคู่ต่อสู้</Text>
            <Button
                title='             bookmark             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('Bookmark',{mark:'hello'})   
                }}
                />
                 <Image
                source={require('E:/reactPro/ReactNativeFinalProject/assets/roulette.jpg')}
                style={styles.sideMenuProfileIcon}
            />
            <Text style = {styles.textheadData}>ท่าหมุนตัว (roulette)</Text>
            <Text style = {styles.textData}>หลังจากที่ฝ่ายตรงข้ามกำลังจะจิ้มขาเข้ามาเพื่อแย่งบอลของคุณ เราสามารถที่จะหมุนตัวเพื่อกันและหลบคู่ต่อสู้ได้ ด้วยการดึงบอลกลับถอยหลังด้วยขาข้างใดข้างหนึ่ง ก่อนที่จะใช้อีกข้างเกี่ยวฟุตบอลเอาไว้พร้อมกับหมุนตัวหลบคู่ต่อสู้</Text>
            <Button
                title='             bookmark             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('Bookmark',{mark:'hello'})   
                }}
                />
                 <Image
                source={require('E:/reactPro/ReactNativeFinalProject/assets/in and out.jpg')}
                style={styles.sideMenuProfileIcon}
            />
            <Text style = {styles.textheadData}>การเลี้ยงบอลอ้อมตัว (in and out)</Text>
            <Text style = {styles.textData}>เป็นท่าที่นิยมใช้กันบ่อยมากในนักเตะที่มีความเร็วและความคล่องตัวสูง เพราะต้องใช้ความเร็วอย่างมากในการเลี้ยงบอลอ้อมตัวผู้เล่น วิธีในการใช้ท่านี้คือเลี้ยงบอลไปยังฝั่งตรงข้ามกันกับที่เราจะวิ่งไปเพื่อลวงให้ฝ่ายตรงข้ามสับสน และในช่วงที่ฝ่ายตรงข้ามกำลังจะก้าวขาแย่งบอล ให้ทำการเตะฟุตบอลไปในทิศทางคนละฝั่งกับขาที่ยื่นออกมา หลังจากเตะแล้วก็ให้วิ่งอ้อมตัวคู่ต่อสู้ไปในทิศตรงข้ามกับลูกบอลก่อนเก็บบอลแล้ววิ่งเลี้ยงบอลต่อไป</Text>
            <Button
                title='             bookmark             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('Bookmark',{mark:'hello'})   
                }}
                />
            <Text style = {styles.textheadData}>เตะบอลรอดหว่างขา (Nut meg, Panna)</Text>
            <Text style = {styles.textData}>การเตะลอดหว่างขอก็จัดได้ว่าเป็นหนึ่งในเทคนิคเลี้ยงบอลนะครับ โดยอาศัยจังหวะที่คู่ต่อสู้พยายามจะแย่งบอลแล้วมีช่องว่างใต้หว่างขามากพอก็ให้ทำการเตะบอลลอดหว่างขอทันที ส่วนตัวเราก็วิ่งอ้อมตัวคู่ต่อสู้ไปเพื่อเก็บบอล การเลี้ยงแบบนี้อาจจะใช้ยากซักหน่อยเพราะจังหวะมีไม่มากนัก แต่ถ้าได้จังหวะแล้วล่ะก็เป็นท่าที่มีประโยชน์มากเลยล่ะ</Text>
            <Button
                title='             bookmark             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('Bookmark',{mark:'hello'})   
                }}
                />
          </View>
          
        </View>      
      </View>
    </ImageBackground>
    </View>
  </ScrollView>
</SafeAreaView>
  )
}

export default SkillScreen

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  image: {
    flex: 1,
    justifyContent: "center"
  },
  text: {
    color: "#111111",
    fontSize: 32,
    fontWeight: "bold",
    textAlign: "center",
    
  },
  textData:{
    color: "#111111",
    fontWeight: "bold",
    
  },
  textheadData:{
    color: "#111111",
    fontWeight: "bold",
    fontSize: 22,
    
  },
  sideMenuProfileIcon: {
    resizeMode: "center",
    width: 300,
    height: 250,
    borderRadius: 100 / 2,
    alignSelf: "center",
  },
  textbox : {
    padding: 20,
    margin:10, 
    backgroundColor: "rgba(240,240,240,0.6)" ,
